  const check = () => {
    setChecked(true);
  };
  return (
    <>
      <div className="todostyle">
        <span>
          <OfflinePinIcon onClick={check} className="Delete-icon" />
        </span>
        <li style={{ textDecoration: chec? "line-through" : "none" }}>
          {props.data}
        </li>
      </div>
    </>
  );
};

export default Listdata;
